    std::array<std::array<float, 2048>, 128> linear_weights_0;
    std::array<float, 128> linear_bias_0;

    // linear layer 1: 128 -> 10
    std::array<std::array<float, 128>, 10> linear_weights_1;
    std::array<float, 10> linear_bias_1;

    // conv2d layer 2: 1x3x3 -> 16
    std::array<std::array<std::array<std::array<float, 3>, 3>, 1>, 16> conv_weights_2;
    std::array<float, 16> conv_bias_2;

    // conv2d layer 3: 16x3x3 -> 32
    std::array<std::array<std::array<std::array<float, 3>, 3>, 16>, 32> conv_weights_3;
    std::array<float, 32> conv_bias_3;

    // relu activation function
    float relu(float x) {
        return std::max(0.0f, x);
    }
    
    // softmax activation function
    std::vector<float> softmax(const std::vector<float>& input) {
        std::vector<float> output(input.size());
        float max_val = *std::max_element(input.begin(), input.end());
        float sum = 0.0f;
        
        for (size_t i = 0; i < input.size(); ++i) {
            output[i] = std::exp(input[i] - max_val);
            sum += output[i];
        }
        
        for (size_t i = 0; i < output.size(); ++i) {
            output[i] /= sum;
        }
        
        return output;
    }

